import React from "react";
import "./styles/boxContentCamera.css";

import "vis/dist/vis.min.css";

export default class BoxContentCamera extends React.Component {
	constructor(props) {
		super(props);
		this.state = {};
	}
	componentDidMount() {}
	render() {
		switch (this.props.boxItem) {
			case "Text":
				return <p>Text Text Text</p>;
			case "ArpLite":
				return <ArpLite />;
		}
	}
}
